  \"2013-03-14T19:29:18.400047\",\n\t\"name\": \"california-geological-survey-geologic-map-indexb7b53\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"All the individual maps from the Geologic
  Atlas of California and the Regional Geologic map series have been georeferenced
  for display in a GIS (and viewable online at http://www.conservation.ca.gov/cgs/information/geologic_mapping/Pages/googlemaps.aspx).
  The purpose of this index is to help users identify the extent and locate geologic
  maps from the California Geological Survey (CGS).The Geologic Atlas of California
  was published between 1958 and 1969. It provides a complete, consistent view of
  the geology of the state, prepared at 1:250,000 scale. The Geologic Atlas uses a
  single set of rock units defined by geologic time, rather than geologic formations
  defined by time, and lithology. This allows a simplified, uniform depiction of geologic
  units. Although more recent and more detailed mapping is available in many areas,
  this set of maps is still the most detailed interpretation available for the entire
  state.In an effort to include new geologic mapping completed after publication of
  the Geologic Atlas of California, CGS began compiling a new Regional Geologic map
  series at the same scale as the Geologic Atlas. The first of this new series was
  published in 1981. The Regional Geologic Maps are the same scale and cover the same
  areas as the previous Geologic Atlas, but show more detail and use geologic formations
  rather than the simplified geologic time-based units. Six Regional Geologic maps
  were published at 1:250,000 before CGS changed to completing and publishing 1:100,000
  scale geologic maps. Publishing at 1:100,000 allows regional geologic maps to show
  nearly all of the detail from the original mapping. CGS has published four Regional
  Geologic maps at 1:100,000 scale and is working on several others.\",\n\t\"license_title\":
